      "title": "Overall Instructions",
      "content": "\u003Cmain class=\"content-horizontal-center content-vertical-center\"\u003E\n \n  \u003Cdiv style=\"width: 90%;\"\u003E\n      \n    \u003Ch2\u003EInstructies\u003C\u002Fh2\u003E\n    \u003Cp class=\"text-left\"\u003EDit experiment gaat over hoe mensen woorden verwerken. Je zal gevraagd woorden om woorden te bekijken en deze vervolgens te beoordelen. \u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003EDe woorden zullen in het midden van het scherm getoond worden. De taak is om te bepalen of het woord op het scherm een echt woord of een nep woord is.\u003C\u002Fp\u003E\n\n    \u003Cp class=\"text-left\"\u003EAls je bijvoorbeeld het echte woord KOUD herkent dan druk je op de \u003Ckbd\u003E${ window.word_key }\u003C\u002Fkbd\u003E toets voor het echte woord. Als het om een nep woord gaat, bijvoorbeeld WERM, dan druk je op de \u003Ckbd\u003E${ window.nonword_key }\u003C\u002Fkbd\u003E toets voor het nep woord. Er is een oefensessie waarin je feedback op je antwoorden zal ontvangen. \u003C\u002Fp\u003E\n    \n\n    \u003Cp class=\"text-left\"\u003EHet doel is om zo snel mogelijk te reageren en tegelijkertijd zo nauwkeurig mogelijk te blijven. Je hebt drie seconden om op elk woord te reageren.\u003C\u002Fp\u003E\n  \n  \u003C\u002Fdiv\u003E\n\n\u003C\u002Fmain\u003E\n\n\u003Cfooter\u003E\n   Druk op de \u003Ckbd\u003ESPATIEBALK\u003C\u002Fkbd\u003E om de oefensessie te starten.\n\u003C\u002Ffooter\u003E",
